fixes.body:
Unlike interfaces, type aliases must have a left hand side and right hand side
of a statement, so code like this is invalid syntax:

```ts
type Person {
  age: number;
  name: string;
}
```

Instead it should look like this:

```ts
type Person = {
  age: number;
  name: string;
};
```

Code like this is trying to implicitly return an object with the map function,
but is actually invalid syntax:

```ts
const items = [["a", 1], ["b", 2]];
const mapped = items.map(([key, value]) => { [key]: value });
```

Instead, use parenthesis (`()`) around the return value:

```ts
const items = [["a", 1], ["b", 2]];
const mapped = items.map(([key, value]) => ({ [key]: value }));
```

documentation:
When writing an index signature, there must be exactly one parameter which is not a rest parameter:

```ts
interface A {
  [...index: string]: boolean;
}
```

fixes.body:
To fix the error, just remove the ellipsis token (`...`):

```ts
interface A {
  [index: string]: boolean;
}
```

If you meant to state that the describes a function, use parenthesis rather than brackets:

```ts
interface A {
  (...args: string[]): boolean;
}
```

documentation:
If an inheritance clause (`extends` or `implements`) has a trailing comma, this
error is reported:

```ts
interface A {}

class B implements A, {
}
```

fixes.body:
Remove the trailing comma:

```ts
interface A {}

class B implements A {
}
```

To fix the error, provide an index or property:

```ts
const a = [1, 2, 3];
const b = a[1];

// or
const c = { d: 4 };
const d = c["d"];
```

documentation:
It is not possible to have multiple rest parameters, or have rest parameters
before regular parameters since they consume all other arguments.

```ts
function printf(...args: any[], format: string) {}
// or
function callMany<T extends any[]>(
  ...functions: ((...args: T[]) => void)[],
  ...args: T
) {}
```

fixes.body:
Consider accepting an array of arguments:

```ts
function printf(args: any[], format: string) {}

function callMany<T extends any[]>(
  functions: ((...args: T[]) => void)[],
  ...args: T
) {}
```

Remove the question mark if the default better communicates your intent, or
remove the initializer:

```ts
function test(a: number = 0) {}
// or
function test(a?: number) {}
```
